    <script>
        $(window).scroll(function () {
            scrollTop($(this))
        });
        function scrollTop(this_) {
            if(this_.scrollTop()<120){
                $('.Content_Navigation').addClass('Navigation_style')
                $('.Format_Example').removeClass('Navigation_style')
                $('.Annotation_Example').removeClass('Navigation_style')
            }
            if (this_.scrollTop() > 600) {
                $('.Format_Example').addClass('Navigation_style')
                $('.Content_Navigation').removeClass('Navigation_style')
                $('.Annotation_Example').removeClass('Navigation_style')
            }

            if(this_.scrollTop()>2100){
                $('.Annotation_Example').addClass('Navigation_style')
                $('.Format_Example').removeClass('Navigation_style')
            }
        }
        scrollTop($(window));

    </script>
